subSubSection.paragraph:
The type series of 

Acanthosaura tongbiguanensis

sp. nov. was collected at night while they were asleep on small trees in a primordial forest. However, we suppose that they forage for food on the ground during the day. At the type locality we found four other species of reptiles, namely 

Cyrtodactylus khasiensis

(Jerdon, 1870), 

Pseudocalotes kakhienensis

(Anderson, 1879); 

P. microlepis

(Boulenger, 1887); 

Trimeresurus yingjiangensis

Chen et al., 2019; and seven species of amphibians, 

Leptobrachella yingjiangensis

(Yang et al., 2018); 

Limnonectes longchuanensis

Suwannapoom et al., 2016; 

Megophrys feii

Yang et al., 2018; 

M. glandulosa

Fei et al., 1990; 

Raorchestes longchuanensis

(Yang & Li, 1978); 

Theloderma moloch

(Annandale, 1912); 

Zhangixalus smaragdinus

(Blyth, 1852).
